package com.itstrongs.tollage;public class Directory {	private String id;	private int key;	private String name;	private String parent_id;	private String extension;	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getName() {		return name;	}	public int getKey() {		return key;	}	public void setKey(int key) {		this.key = key;	}	public void setName(String name) {		this.name = name;	}	public String getParent_id() {		return parent_id;	}	public void setParent_id(String parent_id) {		this.parent_id = parent_id;	}	public String getExtension() {		return extension;	}	public void setExtension(String extension) {		this.extension = extension;	}	@Override	public String toString() {		return "Directory [id=" + id + ", name=" + name + ", parent_id="				+ parent_id + ", extension=" + extension + "]";	}}